  false,\n\t\"url\": null,\n\t\"notes\": \"I have reviewed the chemical characteristics
  of geothermal waters from Well AL-2 of the MJUSD and the proposal to discharge these
  waters in an open unlined ditch, which will run through a corner of the Modoc National
  Wildlife Refuge, either to be discharged into the North Fork of the Pit River or
  into a created wetland on the refuge. You requested that I review the suitability
  of the waters for discharge into the open ditch, the river and/or a created wetland
  and advise you if a liner in the ditch would be desirable.\",\n\t\"owner_org\":
